                //         <div className="qr-code-homepage-cards-icon">
                //             <img src={d.icon} alt="" />
                //         </div>

                //     </div>
                //     <div className="qr-code-homepage-cards-block-name">{d.name}</div>
                //     <div className="qr-code-cards-block-amount">{d.amount}</div>
                // </div>
            ))}
        </div>
    )
}

export default HomeProductCard;
